import EmailForm from '../../components/EmailForm/EmailForm';

function Contact() {
    return (
        <div>
            <section>
                <ul>
                    <li>
                        Email: al.wolfe@gmail.com
                    </li>
                </ul>
            </section>
            <section>
                <EmailForm></EmailForm>
            </section>
        </div>
    );
}

export default Contact;
